  `preciptype` varchar(65) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '',
  `snow` decimal(10, 2) NULL DEFAULT 0.00,
  `snowdepth` decimal(10, 2) NULL DEFAULT 0.00,
  `windgust` decimal(10, 2) NULL DEFAULT 0.00,
  `windspeed` decimal(10, 2) NULL DEFAULT 0.00,
  `winddir` decimal(10, 2) NULL DEFAULT 0.00,
  `pressure` float NULL DEFAULT 0,
