-- ----------------------------
-- Procedure structure for transform_weather_dim
-- ----------------------------
DROP PROCEDURE IF EXISTS `transform_weather_dim`;
delimiter ;;
CREATE PROCEDURE `transform_weather_dim`()
BEGIN
    SELECT DISTINCT
        conditions,
        icon,
        
        -- Chuẩn hóa giá trị preciptype
        CASE
            WHEN preciptype = '[rain]' THEN 'Rain'
            ELSE 'None'
        END AS preciptype,
        
        severerisk,
        cloudcover,
        
        -- Phân loại độ ẩm thành mức (Low, Medium, High)
        CASE
            WHEN humidity <= 40 THEN 'Low'
            WHEN humidity BETWEEN 41 AND 70 THEN 'Medium'
            ELSE 'High'
        END AS humidity_level,
        
        -- Phân loại nhiệt độ thành mức (Cold, Warm, Hot)
        CASE
            WHEN temp < 10 THEN 'Cold'
            WHEN temp BETWEEN 10 AND 25 THEN 'Warm'
            ELSE 'Hot'
        END AS temperature_type,
        
        -- Phân loại điều kiện gió (Calm, Breezy, Windy)
        CASE
            WHEN windspeed < 10 THEN 'Calm'
            WHEN windspeed BETWEEN 10 AND 30 THEN 'Breezy'
            ELSE 'Windy'
        END AS wind_condition
    FROM staging.staging s
    WHERE NOT EXISTS (
        SELECT 1 
        FROM warehouse.dim_weather wd
        WHERE wd.conditions = s.conditions
          AND wd.icon = s.icon
          AND wd.preciptype = CASE
                                  WHEN s.preciptype = '[rain]' THEN 'Rain'
                                  ELSE 'None'
                              END
          AND wd.severerisk = s.severerisk
          AND wd.cloudcover = s.cloudcover
          AND wd.humidity_level = CASE
                                      WHEN s.humidity <= 40 THEN 'Low'
                                      WHEN s.humidity BETWEEN 41 AND 70 THEN 'Medium'
                                      ELSE 'High'
                                  END
          AND wd.temperature_type = CASE
                                        WHEN s.temp < 10 THEN 'Cold'
                                        WHEN s.temp BETWEEN 10 AND 25 THEN 'Warm'
                                        ELSE 'Hot'
                                    END
          AND wd.wind_condition = CASE
                                      WHEN s.windspeed < 10 THEN 'Calm'
                                      WHEN s.windspeed BETWEEN 10 AND 30 THEN 'Breezy'
                                      ELSE 'Windy'
                                  END
    );

	UPDATE staging.staging AS s
JOIN warehouse.dim_weather AS wd
ON s.conditions = wd.conditions
   AND s.icon = wd.icon
   AND CASE
           WHEN s.preciptype = '[rain]' THEN 'Rain'
           ELSE 'None'
       END = wd.preciptype
   AND s.severerisk = wd.severerisk
   AND s.cloudcover = wd.cloudcover
   AND CASE
           WHEN s.humidity <= 40 THEN 'Low'
           WHEN s.humidity BETWEEN 41 AND 70 THEN 'Medium'
           ELSE 'High'
       END = wd.humidity_level
   AND CASE
           WHEN s.temp < 10 THEN 'Cold'
           WHEN s.temp BETWEEN 10 AND 25 THEN 'Warm'
           ELSE 'Hot'
       END = wd.temperature_type
   AND CASE
           WHEN s.windspeed < 10 THEN 'Calm'
           WHEN s.windspeed BETWEEN 10 AND 30 THEN 'Breezy'
           ELSE 'Windy'
       END = wd.wind_condition
SET s.weather_id = wd.id;



END
;;
delimiter ;

